INSERT INTO `wp_posts` VALUES(2, 1, '2018-05-17 14:50:02', '2018-05-17 12:50:02', 'Voici un exemple de page. Elle est différente d’un article de blog, en cela qu’elle restera à la même place, et s’affichera dans le menu de navigation de votre site (en fonction de votre thème). La plupart des gens commencent par écrire une page « À Propos » qui les présente aux visiteurs potentiels du site. Vous pourriez y écrire quelque chose de ce tenant :\r\n<blockquote>Bonjour ! Je suis un mécanicien qui aspire à devenir un acteur, et ceci est mon blog. J’habite à Bordeaux, j’ai un super chien qui s’appelle Russell, et j’aime la vodka-ananas (ainsi que perdre mon temps à regarder la pluie tomber).</blockquote>\r\n...ou bien quelque chose comme cela :\r\n<blockquote>La société 123 Machin Truc a été créée en 1971, et n’a cessé de proposer au public des machins-trucs de qualité depuis cette année. Située à Saint-Remy-en-Bouzemont-Saint-Genest-et-Isson, 123 Machin Truc emploie 2 000 personnes, et fabrique toutes sortes de bidules super pour la communauté bouzemontoise.</blockquote>\r\nÉtant donné que vous êtes un nouvel utilisateur ou une nouvelle utilisatrice de WordPress, vous devriez vous rendre sur votre <a href="http://localhost/ecurie-du-saulcy-54/wp-admin/">tableau de bord</a> pour effacer la présente page, et créer de nouvelles pages avec votre propre contenu. Amusez-vous bien !', 'Page d’exemple', '', 'trash', 'closed', 'open', '', 'page-d-exemple__trashed', '', '', '2018-05-22 13:51:27', '2018-05-22 11:51:27', '', 17, 'http://localhost/ecurie-du-saulcy-54/?page_id=2', 2, 'page', '', 0);
INSERT INTO `wp_posts` VALUES(8, 1, '2018-05-17 15:29:08', '2018-05-17 13:29:08', '<strong>Bienvenue sur le site de l''écurie du Saulcy !</strong>\r\n\r\nBonne visite...\r\n\r\nAlain Salagnat est heureux de vous accueillir à l''Ecurie du Saulcy !\r\n\r\nL''Ecurie du Saulcy, c''est:\r\n<ul>\r\n 	<li>une pension pour chevaux et poneys</li>\r\n 	<li>une école d''équitation</li>\r\n 	<li>un élevage de chevaux de sport</li>\r\n 	<li>une écurie de compétition</li>\r\n</ul>\r\n<img class="aligncenter wp-image-34 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000006.jpg" alt="" width="849" height="566" />\r\n\r\n<img class="aligncenter wp-image-35 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000007.jpg" alt="" width="637" height="308" />', 'ACCUEIL', '', 'publish', 'closed', 'closed', '', 'accueil', '', '', '2018-05-23 17:07:04', '2018-05-23 15:07:04', '', 0, 'http://localhost/ecurie-du-saulcy-54/?page_id=8', 0, 'page', '', 0);
