INSERT INTO `wp_posts` VALUES(23, 1, '2018-05-17 15:33:11', '2018-05-17 13:33:11', 'L''Ecurie du Saulcy accueille vos chevaux et poneys dans d''excellentes conditions.\r\nLes boxes sont spacieux, sur paille. Les rations (alimentation traditionnelle et compléments) sont adaptées aux besoins de chaque cheval.\r\n\r\nCôté infrastructures, vous aurez à votre disposition deux carrières 45 x 90 (une destinée à l''entraînement et une carrière de concours), deux manèges (12 x 36 et 21 x 65), un rond de longe, un club-house, cinq paddocks...\r\n\r\n<strong>Tarif: 320 € par cheval (300€ pour le deuxième cheval et tarif dégressif pour les suivants).</strong>\r\n\r\nCe tarif permet de suivre sans suppléments une REPRISE CLUB par semaine encadrée par la monitrice AMANDINE MOULERES-WARTEL et l''accès aux installations en respectant le planning des cours et stages CLUB.\r\n\r\nDes entraînements de CSO amateur peuvent être prévu en coordination avec Alain SALAGNAT et son cavaliers professionnel mais ceux ci sont payants.\r\n\r\nIl est possible de s''entraîner et de sortir en compétition club et amateur dans les disciplines olympiques; CSO, DRESSAGE, CONCOURS COMPLET et même HUNTER.', 'ÉCURIE PROPRIÉTAIRE', '', 'publish', 'closed', 'closed', '', 'ecurie-proprietaire', '', '', '2018-05-24 09:42:19', '2018-05-24 07:42:19', '', 0, 'http://localhost/ecurie-du-saulcy-54/?page_id=23', 0, 'page', '', 0);
