INSERT INTO `wp_posts` VALUES(26, 1, '2018-05-17 15:33:28', '2018-05-17 13:33:28', '<h1 style="text-align: center;">Elevage</h1>\r\n<h2>Présentation de l''élevage</h2>\r\nLa famille Salagnat est engagée depuis de nombreuses années dans l''élevage de chevaux de sport.\r\n<a href="http://localhost/ecurie-du-saulcy-54/presentation-de-lelevage/">Suite...</a>\r\n<h2>A vendre</h2>\r\nRibot du Saulcy (Mister Blue x Kaoline du Saulcy par Voltaire x Hidalgo du Riou)\r\n<a href="http://localhost/ecurie-du-saulcy-54/elevage/a-vendre/">Suite...</a>\r\n<h2>Les fleurons du Saulcy</h2>\r\nL''élevage du Saulcy a fait naître des chevaux performers au plus haut niveau...\r\n<a href="http://localhost/ecurie-du-saulcy-54/elevage/les-fleurons-du-saulcy/">Suite...</a>\r\n<h2>Les Poulinières</h2>\r\nDeux poulinières sont actuellement en activité à l''élevage du Saulcy:\r\n<a href="http://localhost/ecurie-du-saulcy-54/elevage/les-poulinieres/">Suite...</a>', 'ELEVAGE', '', 'publish', 'closed', 'closed', '', 'elevage', '', '', '2018-05-23 16:53:22', '2018-05-23 14:53:22', '', 0, 'http://localhost/ecurie-du-saulcy-54/?page_id=26', 0, 'page', '', 0);
