INSERT INTO `wp_posts` VALUES(38, 1, '2018-05-22 12:44:45', '2018-05-22 10:44:45', '<strong>Présentation Centre Equestre</strong>\r\n\r\nL''écurie du Saulcy, c''est:\r\n\r\nune écurie d''école; 14 chevaux et 15 poneys.\r\nune ambiance conviviale.\r\ndes reprises pour tous les niveaux, de l''initiation au perfectionnement dés l''âge de 6 ans.\r\ndes reprises BABY PONEYS afin de partager un moment avec son enfant et les poneys (30 minutes) dés 3 ans.\r\nla pratique de la compétition club; saut d''obstacle, dressage, concours complet et hunter.\r\ndes concours internes pour tous les niveaux afin de développer l''esprit de compétition chez les petits.\r\ndes cours particuliers adaptés au niveau de chaque cavalier.\r\ndes reprises sur le plat réservés aux propriétaires avec Amandine.', 'CENTRE EQUESTRE', '', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2018-05-22 12:44:45', '2018-05-22 10:44:45', '', 17, 'http://localhost/ecurie-du-saulcy-54/2018/05/22/17-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(39, 1, '2018-05-22 13:43:31', '2018-05-22 11:43:31', '<h1><strong>Présentation Centre Equestre</strong></h1>\nL''écurie du Saulcy, c''est:\n<ul>\n 	<li>une écurie d''école; 14 chevaux et 15 poneys.</li>\n 	<li>une ambiance conviviale.</li>\n 	<li>des reprises pour tous les niveaux, de l''initiation au perfectionnement dés l''âge de 6 ans.</li>\n 	<li>des reprises BABY PONEYS afin de partager un moment avec son enfant et les poneys (30 minutes) dés 3 ans.</li>\n 	<li>la pratique de la compétition club; saut d''obstacle, dressage, concours complet et hunter.</li>\n 	<li>des concours internes pour tous les niveaux afin de développer l''esprit de compétition chez les petits.</li>\n 	<li>des cours particuliers adaptés au niveau de chaque cavalier.</li>\n 	<li>des reprises sur le plat réservés aux propriétaires avec Amandine.</li>\n</ul>\n<img class="size-medium wp-image-41 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000001-209x300.jpg" alt="" width="209" height="300" />\n\n<img class="size-medium wp-image-43 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000016-249x300.jpg" alt="" width="249" height="300" />\n\n<img class="size-medium wp-image-42 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000009-300x212.jpg" alt="" width="300" height="212" />\n\n&nbsp;\n<h2></h2>\n&nbsp;\n<h1><strong>Tarifs Centre Equestre</strong></h1>\n<img class="size-medium wp-image-60 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000001-1-218x300.jpg" alt="" width="218" height="300" />\n\n<img class="size-medium wp-image-61 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000003-1-218x300.jpg" alt="" width="218" height="300" />\n<h2>Stage</h2>\n<img class="size-medium wp-image-64 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000002-300x189.jpg" alt="" width="300" height="189" />\n\n<img class="size-medium wp-image-63 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000001-2-300x202.jpg" alt="" width="300" height="202" />\n\n<img class="size-medium wp-image-68 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000006-1-218x300.jpg" alt="" width="218" height="300" />\n\n&nbsp;\n\n<img class="size-medium wp-image-65 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000003-2-300x215.jpg" alt="" width="300" height="215" /> <img class="size-medium wp-image-66 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000004-300x215.jpg" alt="" width="300" height="215" /> <img class="size-medium wp-image-67 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000005-1-300x213.jpg" alt="" width="300" height="213" />\n<h2>Activités/compétitions</h2>\n<img class="size-medium wp-image-73 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000007-2-300x212.jpg" alt="" width="300" height="212" /> <img class="size-medium wp-image-74 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000011-1-300x218.jpg" alt="" width="300" height="218" />\n\n<img class="size-medium wp-image-71 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000005-2-218x300.jpg" alt="" width="218" height="300" />\n\n<img class="size-medium wp-image-72 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000006-2-218x300.jpg" alt="" width="218" height="300" />', 'CENTRE EQUESTRE', '', 'inherit', 'closed', 'closed', '', '17-autosave-v1', '', '', '2018-05-22 13:43:31', '2018-05-22 11:43:31', '', 17, 'http://localhost/ecurie-du-saulcy-54/2018/05/22/17-autosave-v1/', 0, 'revision', '', 0);
