INSERT INTO `wp_posts` VALUES(50, 1, '2018-05-22 12:57:32', '2018-05-22 10:57:32', '<h1><strong>Présentation Centre Equestre</strong></h1>\r\nL''écurie du Saulcy, c''est:\r\n<ul>\r\n 	<li>une écurie d''école; 14 chevaux et 15 poneys.</li>\r\n 	<li>une ambiance conviviale.</li>\r\n 	<li>des reprises pour tous les niveaux, de l''initiation au perfectionnement dés l''âge de 6 ans.</li>\r\n 	<li>des reprises BABY PONEYS afin de partager un moment avec son enfant et les poneys (30 minutes) dés 3 ans.</li>\r\n 	<li>la pratique de la compétition club; saut d''obstacle, dressage, concours complet et hunter.</li>\r\n 	<li>des concours internes pour tous les niveaux afin de développer l''esprit de compétition chez les petits.</li>\r\n 	<li>des cours particuliers adaptés au niveau de chaque cavalier.</li>\r\n 	<li>des reprises sur le plat réservés aux propriétaires avec Amandine.</li>\r\n</ul>\r\n<img class="size-medium wp-image-41 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000001-209x300.jpg" alt="" width="209" height="300" />\r\n\r\n<img class="size-medium wp-image-43 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000016-249x300.jpg" alt="" width="249" height="300" />\r\n\r\n<img class="size-medium wp-image-42 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000009-300x212.jpg" alt="" width="300" height="212" />\r\n\r\n&nbsp;\r\n<h2><strong>Activités diverses</strong></h2>\r\nAccueil des scolaires et des groupes de vacances.\r\n\r\nAccueil des handicapés.\r\n\r\nStages vacances scolaires.\r\n\r\nNous vous accueillons dans des infrastructures de qualité:\r\n<ul>\r\n 	<li>2 carrières (45x90m) avec arrosage automatique</li>\r\n 	<li>2 manèges couverts (21x65m et 12x36m)</li>\r\n 	<li>1 marcheur</li>\r\n 	<li>1 terrain de cross</li>\r\n 	<li>1 rond de longe</li>\r\n 	<li>1 club house</li>\r\n 	<li>5 paddocks</li>\r\n</ul>\r\nCours variés; plat, obstacle, dressage, hunter, cross, pony-games, equifun, ... découverte de l''éthologie.\r\nCréation de spectacles; Noël, fête du cheval...\r\n\r\n<img class="size-medium wp-image-46 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000003-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-47 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000005-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-48 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000007-1-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-49 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000008-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n&nbsp;', 'CENTRE EQUESTRE', '', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2018-05-22 12:57:32', '2018-05-22 10:57:32', '', 17, 'http://localhost/ecurie-du-saulcy-54/2018/05/22/17-revision-v1/', 0, 'revision', '', 0);
