ter, cross, pony-games, equifun, ... découverte de l''éthologie.\r\nCréation de spectacles; Noël, fête du cheval...\r\n\r\n<img class="size-medium wp-image-46 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000003-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-47 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000005-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-48 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000007-1-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-49 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000008-218x300.jpg" alt="" width="218" height="300" />\r\n<h2>Les chevaux du club</h2>\r\n<img class="size-medium wp-image-51 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000010-300x218.jpg" alt="" width="300" height="218" />\r\n\r\n<img class="size-medium wp-image-52 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000011-300x218.jpg" alt="" width="300" height="218" />\r\n<h2>Les poneys</h2>\r\n<img class="size-medium wp-image-53 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000012-300x218.jpg" alt="" width="300" height="218" />\r\n\r\n<img class="size-medium wp-image-54 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000013-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-55 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000015-300x218.jpg" alt="" width="300" height="218" />\r\n<h2>GLANEUR est parti à la retraite et MANAGUA vit une nouvelle vie au parc.</h2>\r\n<h1><strong>Planning centre équestre</strong></h1>\r\n<img class="size-medium wp-image-57 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000008-1-300x181.jpg" alt="" width="300" height="181" />\r\n\r\nJe vous invite à me transmettre rapidement vos questions, suggestions et remarques afin de pouvoir ajuster au mieux ce dernier.\r\n<h1><strong>Tarifs Centre Equestre</strong></h1>\r\n<img class="size-medium wp-image-60 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000001-1-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-61 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000003-1-218x300.jpg" alt="" width="218" height="300" />\r\n<h2>Stage</h2>\r\n<img class="size-medium wp-image-64 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000002-300x189.jpg" alt="" width="300" height="189" />\r\n\r\n<img class="size-medium wp-image-63 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000001-2-300x202.jpg" alt="" width="300" height="202" />\r\n\r\n<img class="size-medium wp-image-68 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000006-1-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n&nbsp;\r\n\r\n<img class="size-medium wp-image-65 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000003-2-300x215.jpg" alt="" width="300" height="215" /> <img class="size-medium wp-image-66 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000004-300x215.jpg" alt="" width="300" height="215" /> <img class="size-medium wp-image-67 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000005-1-300x213.jpg" alt="" width="300" height="213" />\r\n<h2>Activités/compétitions</h2>\r\n<img class="size-medium wp-image-73 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000007-2-300x212.jpg" alt="" width="300" height="212" /> <img class="size-medium wp-image-74 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000011-1-300x218.jpg" alt="" width="300" height="218" />\r\n\r\n<img class="size-medium wp-image-71 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000005-2-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-72 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000006-2-218x300.jpg" alt="" width="218" height="300" />', 'CENTRE EQUESTRE', '', 'inherit', 'closed', 'closed', '', '17-revision-v1', '', '', '2018-05-22 13:31:08', '2018-05-22 11:31:08', '', 17, 'http://localhost/ecurie-du-saulcy-54/2018/05/22/17-revision-v1/', 0, 'revision', '', 0);
