ds/2018/05/bv000012-300x218.jpg" alt="" width="300" height="218" />\r\n\r\n<img class="size-medium wp-image-54 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000013-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-55 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000015-300x218.jpg" alt="" width="300" height="218" />\r\n<h2>GLANEUR est parti à la retraite et MANAGUA vit une nouvelle vie au parc.</h2>', 'Activités diverses', '', 'inherit', 'closed', 'closed', '', '80-revision-v1', '', '', '2018-05-22 13:42:57', '2018-05-22 11:42:57', '', 80, 'http://localhost/ecurie-du-saulcy-54/2018/05/22/80-revision-v1/', 0, 'revision', '', 0);
