INSERT INTO `wp_posts` VALUES(175, 1, '2018-05-23 16:01:47', '2018-05-23 14:01:47', '<h1>Divers 2017</h1>\n<p style="text-align: center;">[metaslider id=100]</p>\n\n<h1>CSO 2017</h1>\n<p style="text-align: center;">[metaslider id=114]</p>\n\n<h1>Halloween 2017</h1>\n<p style="text-align: center;">[metaslider id=173]</p>\n\n<h1>Hunter 01/10/2017</h1>\n<p style="text-align: center;">[metaslider id=174]</p>\n\n<h1>Carnaval 2016</h1>\n<p style="text-align: center;">[metaslider id=254]</p>\n\n<h1>Challenge interne club dressage 28/02/2016</h1>\n<p style="text-align: center;">[metaslider id=281]</p>\n\n<h1>Challenge interne club du dimanche 24 janvier 2016</h1>\n<p style="text-align: center;">[metaslider id=296]</p>\n\n<h1>Les 20 ans du Saulcy</h1>\nLe 21 septembre 2014, on fêtait le vingtième anniversaire du Saulcy. Emotion et bonne humeur étaient au rendez-vous.\n<p style="text-align: center;">[metaslider id=315]</p>', 'ACTUALITE', '', 'inherit', 'closed', 'closed', '', '11-autosave-v1', '', '', '2018-05-23 16:01:47', '2018-05-23 14:01:47', '', 11, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/11-autosave-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(176, 1, '2018-05-23 15:33:14', '2018-05-23 13:33:14', '<h1 style="text-align: center;">Présentation de l''élevage</h1>\r\nLa famille Salagnat est engagée depuis de nombreuses années dans l''élevage de chevaux de sport.\r\n<h2 style="text-align: left;">Roger et Alain Salagnat</h2>\r\n<p style="text-align: center;">[metaslider id="491"]</p>\r\n\r\n<h2>Ulmos du Saulcy, fleuron de l''élevage du Saulcy, gagnant en grands prix et CSI</h2>\r\n<img class="alignnone size-full wp-image-502" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/ulmos.jpg" alt="" width="261" height="193" />\r\n<h2>Hysope du Saulcy, 8e à la finale 6ans</h2>\r\nISO 154 à 7 ans et ISO 165 à 8 ans\r\n\r\n<img class="alignnone size-medium wp-image-517" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/hisop_1-1-300x216.jpg" alt="" width="300" height="216" />\r\n<h2>Idéal du Saulcy, finale 5ans</h2>\r\nISO 145 à 7 ans\r\n\r\n<img class="alignnone size-medium wp-image-519" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/hisop_2-1-300x214.jpg" alt="" width="300" height="214" />\r\n<h2>Nausicaa du Saulcy à l''international</h2>\r\n<p style="text-align: left;">[metaslider id="512"]</p>', 'Présentation de l''élevage', '', 'publish', 'closed', 'closed', '', 'presentation-de-lelevage', '', '', '2018-05-24 09:31:13', '2018-05-24 07:31:13', '', 26, 'http://localhost/ecurie-du-saulcy-54/?page_id=176', 0, 'page', '', 0);
