INSERT INTO `wp_posts` VALUES(282, 1, '2018-05-23 15:43:05', '2018-05-23 13:43:05', '<h1 style="text-align: center;">Elevage</h1>\r\n<h2>Présentation de l''élevage</h2>\r\nLa famille Salagnat est engagée depuis de nombreuses années dans l''élevage de chevaux de sport.\r\n<a href="http://localhost/ecurie-du-saulcy-54/presentation-de-lelevage/">Suite...</a>\r\n<h2>A vendre</h2>\r\nRibot du Saulcy (Mister Blue x Kaoline du Saulcy par Voltaire x Hidalgo du Riou)\r\n', 'ELEVAGE', '', 'inherit', 'closed', 'closed', '', '26-revision-v1', '', '', '2018-05-23 15:43:05', '2018-05-23 13:43:05', '', 26, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/26-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(447, 1, '2018-05-23 16:45:29', '2018-05-23 14:45:29', '<h1>Présentation de l''Association Association Ecurie Du Saulcy</h1>\r\n<h2>LE BUREAU</h2>\r\nRéunions tous les premiers lundi du mois au club house 20h.\r\n<ul>\r\n 	<li><strong>Le président : </strong>René MUTZIG</li>\r\n 	<li><strong>Le vice président : </strong>Eric Nabet</li>\r\n 	<li><strong>La secrétaire : </strong>Amandine MOULERES-WARTEL</li>\r\n 	<li><strong>La secrétaire adjointe : </strong>Julie CORVISIER</li>\r\n 	<li><strong>Le trésorier : </strong>Philipe GUYOT</li>\r\n 	<li><strong>La trésorière adjointe : </strong>Sandrine SIMON</li>\r\n</ul>\r\n<h2>MEMBRES DE L''ASSOCIATION</h2>\r\nLes cavaliers du club et leur famille.\r\n<h2>BUT DE L''ASSOCIATION</h2>\r\n<ul>\r\n 	<li>L''organisation des manifestations à l''écurie du Saulcy;</li>\r\n 	<li>Concours club mai et septembre.</li>\r\n 	<li>Concours amateurs mai et septembre.</li>\r\n 	<li>Fête du cheval.</li>\r\n 	<li>Soirée choucroute.</li>\r\n 	<li>Aider les cavaliers du Saulcy dans la réalisation de projet sportifs (Exemple : participation au championnat de France.)</li>\r\n</ul>\r\n<img class="aligncenter wp-image-445 size-full" style="color: #333333; font-style: normal; font-weight: 300;" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000005-13.jpg" alt="" width="590" height="812" />\r\n\r\n<img class="aligncenter wp-image-442 size-full" style="color: #333333; font-style: normal; font-weight: 300;" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000002-9.jpg" alt="" width="849" height="566" />\r\n\r\n<img class="aligncenter wp-image-443 size-full" style="font-weight: 300;" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000003-12.jpg" alt="" width="812" height="590" />\r\n\r\n<img class="aligncenter wp-image-444 size-full" style="font-weight: 300;" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000004-9.jpg" alt="" width="800" height="600" /><span style="font-weight: 300;"> </span>', 'ASSOCIATION', '', 'inherit', 'closed', 'closed', '', '14-revision-v1', '', '', '2018-05-23 16:45:29', '2018-05-23 14:45:29', '', 14, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/14-revision-v1/', 0, 'revision', '', 0);
