INSERT INTO `wp_posts` VALUES(352, 1, '2018-05-23 16:01:53', '2018-05-23 14:01:53', '<h1>Divers 2017</h1>\r\n<p style="text-align: center;">[metaslider id=100]</p>\r\n\r\n<h1>CSO 2017</h1>\r\n<p style="text-align: center;">[metaslider id=114]</p>\r\n\r\n<h1>Halloween 2017</h1>\r\n<p style="text-align: center;">[metaslider id=173]</p>\r\n\r\n<h1>Hunter 01/10/2017</h1>\r\n<p style="text-align: center;">[metaslider id=174]</p>\r\n\r\n<h1>Carnaval 2016</h1>\r\n<p style="text-align: center;">[metaslider id=254]</p>\r\n\r\n<h1>Challenge interne club dressage 28/02/2016</h1>\r\n<p style="text-align: center;">[metaslider id=281]</p>\r\n\r\n<h1>Challenge interne club du dimanche 24 janvier 2016</h1>\r\n<p style="text-align: center;">[metaslider id=296]</p>\r\n\r\n<h1>Les 20 ans du Saulcy</h1>\r\nLe 21 septembre 2014, on fêtait le vingtième anniversaire du Saulcy. Emotion et bonne humeur étaient au rendez-vous.\r\n<p style="text-align: center;">[metaslider id=315]</p>', 'ACTUALITE', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2018-05-23 16:01:53', '2018-05-23 14:01:53', '', 11, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/11-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(353, 1, '2018-05-23 16:08:20', '2018-05-23 14:08:20', '<h1 style="text-align: center;">Les fleurons du Saulcy</h1>\r\nL''élevage du Saulcy a fait naître des chevaux performers au plus haut niveau.\r\n<h2>Voici quelques uns de ses ambassadeurs:</h2>\r\n<h2>Ulmos du Saulcy</h2>\r\n<img class="alignnone size-full wp-image-620" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron1.jpg" alt="" width="261" height="190" />\r\n\r\nEtalon privé - ISO 160 - CSI\r\n\r\nIl a notamment produit:\r\n<ul>\r\n 	<li>ELODEE ICC 132(2004)</li>\r\n 	<li>FULMOS DE NEUVILLE ISO 140(2001) - CSI</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n</ul>\r\n&nbsp;\r\n<h2>Hysope du Saulcy</h2>\r\n<img class="alignnone size-full wp-image-622" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron2.jpg" alt="" width="261" height="190" />\r\n\r\nISO 165(2003) - CSI, performer jusqu''en épreuves 155\r\n\r\n&nbsp;\r\n<h2>Iris du Saulcy</h2>\r\nISO 139(2004) - CSI, performer jusqu''en épreuves 140\r\n\r\n&nbsp;\r\n<h2>Légende du Saulcy</h2>\r\nISO 147(2008) - CSI, performer jusqu''en épreuves 135\r\n\r\n&nbsp;\r\n<h2>Daryl du Saulcy</h2>\r\n<img class="alignnone size-full wp-image-625" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron3.jpg" alt="" width="130" height="85" />\r\n\r\nISO 130(1999) - CSI sous couleurs suisses\r\n\r\n&nbsp;\r\n<h2>Ortie du Saulcy</h2>\r\nISO 130(1987)\r\n\r\n&nbsp;\r\n<h2>Relko du Saulcy</h2>\r\nISO 157(1993) - CSI\r\n\r\n&nbsp;\r\n<h2>Sierra du Saulcy</h2>\r\nISO 133(1991)\r\n\r\n&nbsp;\r\n<h2>Dome du Saulcy</h2>\r\nISO 126(2000)\r\n\r\n&nbsp;\r\n<h2>GALAXIE DU SAULCY ISO 123(1998)</h2>\r\nISO 123(1998)\r\n\r\n&nbsp;\r\n<h2>IDEAL DU SAULCY</h2>\r\n<img class="alignnone size-full wp-image-626" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron4.jpg" alt="" width="240" height="170" />\r\n\r\nISO 147(2004) - CSI\r\n\r\n&nbsp;\r\n<h2>NAUSICAA DU SAULCY</h2>\r\n<img class="alignnone size-medium wp-image-627" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron5-300x200.jpg" alt="" width="300" height="200" />\r\n\r\nISO 143(2008) - CSI\r\n\r\n<img class="alignnone size-medium wp-image-628" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron6-200x300.jpg" alt="" width="200" height="300" />', 'Les fleurons du Saulcy', '', 'publish', 'closed', 'closed', '', 'les-fleurons-du-saulcy', '', '', '2018-05-24 10:28:13', '2018-05-24 08:28:13', '', 26, 'http://localhost/ecurie-du-saulcy-54/?page_id=353', 2, 'page', '', 0);
