INSERT INTO `wp_posts` VALUES(383, 1, '2018-05-23 16:08:20', '2018-05-23 14:08:20', '<h1 style="text-align: center;">Les fleurons du Saulcy</h1>\r\nL''élevage du Saulcy a fait naître des chevaux performers au plus haut niveau.\r\n\r\nVoici quelques uns de ses ambassadeurs:\r\n\r\n&nbsp;', 'Les fleurons du Saulcy', '', 'inherit', 'closed', 'closed', '', '353-revision-v1', '', '', '2018-05-23 16:08:20', '2018-05-23 14:08:20', '', 353, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/353-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(384, 1, '2018-05-23 16:14:33', '2018-05-23 14:14:33', '<h1 style="text-align: center;">Les Poulinières</h1>\r\nDeux poulinières sont actuellement en activité à l''élevage du Saulcy:\r\n\r\n&nbsp;\r\n<h2>Nigelle du Saulcy</h2>\r\n<img class="aligncenter wp-image-633 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/pouliniere1.jpg" alt="" width="512" height="300" />\r\n\r\nSon père, Ulmos du Saulcy, très grand gagnant en CSO, ISO 160, s''avère être également un excellent reproducteur. Il a notamment produit ELODE ICC 132(20044), FULMOS DE NEUVILLE ISO 140(2001), HYSOPE DU SAULCY ISO 165(2003), ILLA II ISO 140(2002)...\r\n\r\nSa mère, STAR DE L''OLIVIERE, par DOUBLE ESPOIR, ISO 133(1992) a notamment produit:\r\n<ul id="s2h">\r\n 	<li>BEAU SOLEIL II, par CHAMBERLIN, ISO 122(2003)</li>\r\n 	<li><b>HYSOPE DU SAULCY, par ULMOS DU SAULCY, ISO 165(2003), propre frère de Nigelle</b></li>\r\n 	<li>IRIS DU SAULCY, par QUEL TYPE D''ELLE, ISO 139(2004)</li>\r\n 	<li><b>LEGENDE DU SAULCY,par AHORN (NL), ISO 147(2008)</b></li>\r\n</ul>\r\n<b>C''est la famille maternelle de ECHO DE CAVRON  ISO 175(1980) IE SO, JIJI DE CAVRON ISO 158(1983), ROI DE CAVRON IE SO...</b>\r\n\r\n&nbsp;\r\n<h2>Kaoline du Saulcy</h2>\r\n<img class="wp-image-637 size-full aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/pouliniere2.jpg" alt="" width="512" height="300" />\r\n\r\nCette poulinière associe le sang de Voltaire à celui précieux d''Uriel par son fils, Hidalgo de Riou.\r\n\r\nSon père, Voltaire, très grand reproducteur, est le père notamment de KELLEMOI DE PEPITAISO 178(2010) BSO +18(0.63) et des étalons KANNAN ISO 178(2004) BSO +28(0.98), IMPERIAL D''HERBIERS ISO 159(2006) BSO +19(0.82), KLOTAIRE DU MOULIN ISO 176(2007) BSO +16(0.62)...\r\n\r\nSa mère, Vestale du Saulcy a huit produits indicés sur onze en âge de l''être:\r\n<ul id="s2h">\r\n 	<li>DOME DU SAULCY, par LE PEGRIOT, ISO 126(2000)</li>\r\n 	<li>GALAXIE DU SAULCY, par KAN VIENS TU, ISO 123(1998)</li>\r\n 	<li><b>IDEAL DU SAULCY, par QUEL TYPE D''ELLE, ISO 147(2004)</b></li>\r\n 	<li>LINGOT DU SAULCY, par CALANDO I (DE),ISO 121(2009)</li>\r\n 	<li><b>NAUSICAA DU SAULCY,par MR BLUE (NL), ISO 143(2008)</b></li>\r\n</ul>\r\nSa deuxième mère, AMAZONE D, par QUELTIMATE, a notamment produit:\r\n<ul id="s2h">\r\n 	<li>ORTIE DU SAULCY, par HIDALGO DE RIOU, ISO 130(1987)</li>\r\n 	<li><b>RELKO DU SAULCY,par HIDALGO DE RIOU, ISO 157(1993) </b></li>\r\n 	<li><b> SIERRA DU SAULCY, ISO 133(1991) </b></li>\r\n 	<li>ULMOS DU SAULCY, par HIDALGO DE RIOU, ISO 160(1995)  Etalon privé**</li>\r\n</ul>\r\n&nbsp;\r\n<h2>Voir la production à vendre</h2>\r\n<a href="http://localhost/ecurie-du-saulcy-54/elevage/a-vendre/">Cliquez ici</a>&nbsp;', 'Les Poulinières', '', 'publish', 'closed', 'closed', '', 'les-poulinieres', '', '', '2018-05-24 11:13:00', '2018-05-24 09:13:00', '', 26, 'http://localhost/ecurie-du-saulcy-54/?page_id=384', 3, 'page', '', 0);
