INSERT INTO `wp_posts` VALUES(398, 1, '2018-05-23 16:17:37', '2018-05-23 14:17:37', '<h1>Divers 2017</h1>\r\n<p style="text-align: center;">[metaslider id=100]</p>\r\n\r\n<h1>CSO 2017</h1>\r\n<p style="text-align: center;">[metaslider id=114]</p>\r\n\r\n<h1>Halloween 2017</h1>\r\n<p style="text-align: center;">[metaslider id=173]</p>\r\n\r\n<h1>Hunter 01/10/2017</h1>\r\n<p style="text-align: center;">[metaslider id=174]</p>\r\n\r\n<h1>Carnaval 2016</h1>\r\n<p style="text-align: center;">[metaslider id=254]</p>\r\n\r\n<h1>Challenge interne club dressage 28/02/2016</h1>\r\n<p style="text-align: center;">[metaslider id=281]</p>\r\n\r\n<h1>Challenge interne club du dimanche 24 janvier 2016</h1>\r\n<p style="text-align: center;">[metaslider id=296]</p>\r\n\r\n<h1>Les 20 ans du Saulcy</h1>\r\nLe 21 septembre 2014, on fêtait le vingtième anniversaire du Saulcy. Emotion et bonne humeur étaient au rendez-vous.\r\n<p style="text-align: center;">[metaslider id=315]</p>\r\n\r\n<h1>Derby cross et matinée magique</h1>\r\nCe lundi de Pentecôte, l''écurie du Saulcy organisait une "matinée magique" pour les petits cavaliers; les petits cavaliers ont déguisé leurs poneys puis ont défilé devant un jury composé de cavaliers expérimentés du club. Ensuite les petits cavaliers ont réalisé un petit parcours de gymkhana. La journée s''est terminée par un grand rangement du club où chaque cavalier a donné de son temps...\r\n<p style="text-align: center;">[metaslider id=354]</p>\r\n\r\n<h1>Cours adultes</h1>\r\nComme quoi on peut apprendre, s''amuser, se faire plaisir à tout âge!!!\r\n<p style="text-align: center;">[metaslider id=386]</p>', 'ACTUALITE', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2018-05-23 16:17:37', '2018-05-23 14:17:37', '', 11, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/11-revision-v1/', 0, 'revision', '', 0);
