INSERT INTO `wp_posts` VALUES(425, 1, '2018-05-23 16:41:50', '2018-05-23 14:41:50', '<h1>Présentation de l''Association Association Ecurie Du Saulcy</h1>\r\n<h2>LE BUREAU</h2>\r\nRéunions tous les premiers lundi du mois au club house 20h.\r\n<ul>\r\n 	<li><strong>Le président : </strong>René MUTZIG</li>\r\n 	<li><strong>Le vice président : </strong>Eric Nabet</li>\r\n 	<li><strong>La secrétaire : </strong>Amandine MOULERES-WARTEL</li>\r\n 	<li><strong>La secrétaire adjointe : </strong>Julie CORVISIER</li>\r\n 	<li><strong>Le trésorier : </strong>Philipe GUYOT</li>\r\n 	<li><strong>La trésorière adjointe : </strong>Sandrine SIMON</li>\r\n</ul>\r\n<h2>MEMBRES DE L''ASSOCIATION</h2>\r\nLes cavaliers du club et leur famille.\r\n<h2>BUT DE L''ASSOCIATION</h2>\r\n<ul>\r\n 	<li>L''organisation des manifestations à l''écurie du Saulcy;</li>\r\n 	<li>Concours club mai et septembre.</li>\r\n 	<li>Concours amateurs mai et septembre.</li>\r\n 	<li>Fête du cheval.</li>\r\n 	<li>Soirée choucroute.</li>\r\n 	<li>Aider les cavaliers du Saulcy dans la réalisation de projet sportifs (Exemple : participation au championnat de France.)</li>\r\n</ul>\r\n<img class="size-medium wp-image-445 aligncenter" style="color: #333333; font-style: normal; font-weight: 300;" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000005-13-218x300.jpg" alt="" width="218" height="300" />\r\n\r\n<img class="size-medium wp-image-442 aligncenter" style="color: #333333; font-style: normal; font-weight: 300;" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000002-9-300x200.jpg" alt="" width="300" height="200" />\r\n\r\n<img class="size-medium wp-image-443 aligncenter" style="font-weight: 300;" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000003-12-300x218.jpg" alt="" width="300" height="218" />\r\n\r\n<img class="size-medium wp-image-444 aligncenter" style="font-weight: 300;" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000004-9-300x225.jpg" alt="" width="300" height="225" /><span style="font-weight: 300;"> </span>', 'ASSOCIATION', '', 'inherit', 'closed', 'closed', '', '14-autosave-v1', '', '', '2018-05-23 16:41:50', '2018-05-23 14:41:50', '', 14, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/14-autosave-v1/', 0, 'revision', '', 0);
