INSERT INTO `wp_posts` VALUES(487, 1, '2018-05-23 17:01:09', '2018-05-23 15:01:09', '<h1><strong>Présentation Centre Equestre</strong></h1>\r\nL''écurie du Saulcy, c''est:\r\n<ul>\r\n 	<li>une écurie d''école; 14 chevaux et 15 poneys.</li>\r\n 	<li>une ambiance conviviale.</li>\r\n 	<li>des reprises pour tous les niveaux, de l''initiation au perfectionnement dés l''âge de 6 ans.</li>\r\n 	<li>des reprises BABY PONEYS afin de partager un moment avec son enfant et les poneys (30 minutes) dés 3 ans.</li>\r\n 	<li>la pratique de la compétition club; saut d''obstacle, dressage, concours complet et hunter.</li>\r\n 	<li>des concours internes pour tous les niveaux afin de développer l''esprit de compétition chez les petits.</li>\r\n 	<li>des cours particuliers adaptés au niveau de chaque cavalier.</li>\r\n 	<li>des reprises sur le plat réservés aux propriétaires avec Amandine.</li>\r\n</ul>\r\n<img class="aligncenter wp-image-41 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000001.jpg" alt="" width="267" height="384" />\r\n\r\n<img class="size-medium wp-image-43 aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000016-249x300.jpg" alt="" width="249" height="300" />\r\n\r\n<img class="aligncenter wp-image-42 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000009.jpg" alt="" width="800" height="566" />\r\n\r\n&nbsp;', 'Présentation Centre Equestre', '', 'inherit', 'closed', 'closed', '', '76-revision-v1', '', '', '2018-05-23 17:01:09', '2018-05-23 15:01:09', '', 76, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/76-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(488, 1, '2018-05-23 17:01:25', '2018-05-23 15:01:25', '<h1><strong>2Planning centre équestre</strong></h1>\r\n<img class="aligncenter wp-image-57 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000008-1.jpg" alt="" width="891" height="539" />\r\n\r\nJe vous invite à me transmettre rapidement vos questions, suggestions et remarques afin de pouvoir ajuster au mieux ce dernier.', 'Planning centre équestre', '', 'inherit', 'closed', 'closed', '', '82-revision-v1', '', '', '2018-05-23 17:01:25', '2018-05-23 15:01:25', '', 82, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/82-revision-v1/', 0, 'revision', '', 0);
