INSERT INTO `wp_posts` VALUES(499, 1, '2018-05-23 17:07:04', '2018-05-23 15:07:04', '<strong>Bienvenue sur le site de l''écurie du Saulcy !</strong>\r\n\r\nBonne visite...\r\n\r\nAlain Salagnat est heureux de vous accueillir à l''Ecurie du Saulcy !\r\n\r\nL''Ecurie du Saulcy, c''est:\r\n<ul>\r\n 	<li>une pension pour chevaux et poneys</li>\r\n 	<li>une école d''équitation</li>\r\n 	<li>un élevage de chevaux de sport</li>\r\n 	<li>une écurie de compétition</li>\r\n</ul>\r\n<img class="aligncenter wp-image-34 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000006.jpg" alt="" width="849" height="566" />\r\n\r\n<img class="aligncenter wp-image-35 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000007.jpg" alt="" width="637" height="308" />', 'ACCUEIL', '', 'inherit', 'closed', 'closed', '', '8-revision-v1', '', '', '2018-05-23 17:07:04', '2018-05-23 15:07:04', '', 8, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/8-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(501, 1, '2018-05-24 09:31:04', '2018-05-24 07:31:04', '<h1 style="text-align: center;">Présentation de l''élevage</h1>\nLa famille Salagnat est engagée depuis de nombreuses années dans l''élevage de chevaux de sport.\n<h2 style="text-align: left;">Roger et Alain Salagnat</h2>\n<p style="text-align: center;">[metaslider id="491"]</p>\n\n<h2>Ulmos du Saulcy, fleuron de l''élevage du Saulcy, gagnant en grands prix et CSI</h2>\n<img class="alignnone size-full wp-image-502" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/ulmos.jpg" alt="" width="261" height="193" />\n<h2>Hysope du Saulcy, 8e à la finale 6ans</h2>\nISO 154 à 7 ans et ISO 165 à 8 ans\n\n<img class="alignnone size-medium wp-image-517" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/hisop_1-1-300x216.jpg" alt="" width="300" height="216" />\n<h2>Idéal du Saulcy, finale 5ans</h2>\nISO 145 à 7 ans\n\n<img class="alignnone size-medium wp-image-519" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/hisop_2-1-300x214.jpg" alt="" width="300" height="214" />\n<h2>Nausicaa du Saulcy à l''international</h2>\n<p style="text-align: center;">[metaslider id="512"]</p>', 'Présentation de l''élevage', '', 'inherit', 'closed', 'closed', '', '176-autosave-v1', '', '', '2018-05-24 09:31:04', '2018-05-24 07:31:04', '', 176, 'http://localhost/ecurie-du-saulcy-54/2018/05/23/176-autosave-v1/', 0, 'revision', '', 0);
