INSERT INTO `wp_posts` VALUES(520, 1, '2018-05-24 09:29:16', '2018-05-24 07:29:16', 'Merci de lire avec attention les différentes modalités d’utilisation du présent site avant d’y parcourir ses pages. En vous connectant sur ce site, vous acceptez sans réserves les présentes modalités. Aussi, conformément à l’article n°6 de la Loi n°2004-575 du 21 Juin 2004 pour la confiance dans l’économie numérique, les responsables du présent site internet <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a> sont :\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Editeur du Site : </b></span></p>\r\nVisiorank\r\nNuméro de SIRET : 81046332300016\r\nResponsable editorial : Visiorank\r\n02 Rue Robert Schuman 44400 Rezé\r\nTéléphone :02 30 98 13 93 - Fax : 02 30 98 13 93\r\nEmail : contact@visiorank.net\r\nSite Web : <a href="http://www.visiorank.net">www.visiorank.net</a>\r\n<p style="color: #b51a00;"><b><span style="color: #000000;">Hébergement :</span> </b></p>\r\nHébergeur : OVH\r\n2 rue Kellermann - 59100 Roubaix - France\r\nSite Web : <a href="http://www.ovh.com">www.ovh.com</a>\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Développement</b><b> : </b></span></p>\r\nVisiorank\r\nAdresse : 02 Rue Robert Schuman 44400 Rezé\r\nSite Web : <a href="http://www.visiorank.net">www.visiorank.net</a>\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Conditions d’utilisation : </b></span></p>\r\nCe site (<a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a>) est proposé en différents langages web (HTML, HTML5, Javascript, CSS, etc…) pour un meilleur confort d''utilisation et un graphisme plus agréable, nous vous recommandons de recourir à des navigateurs modernes comme Internet explorer, Safari, Firefox, Google Chrome, etc…\r\nLes mentions légales ont été générées sur le site <a title="générateur de mentions légales pour site internet gratuit" href="http://www.generateur-de-mentions-legales.com">Générateur de mentions légales</a>, offert par <a title="imprimerie paris, imprimeur paris" href="http://welye.com">Welye</a>.\r\n\r\n<span style="color: #323333;">Visiorank<b> </b></span>met en œuvre tous les moyens dont elle dispose, pour assurer une information fiable et une mise à jour fiable de ses sites internet. Toutefois, des erreurs ou omissions peuvent survenir. L''internaute devra donc s''assurer de l''exactitude des informations auprès de , et signaler toutes modifications du site qu''il jugerait utile. n''est en aucun cas responsable de l''utilisation faite de ces informations, et de tout préjudice direct ou indirect pouvant en découler.\r\n\r\n<b>Cookies</b> : Le site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a> peut-être amené à vous demander l’acceptation des cookies pour des besoins de statistiques et d''affichage. Un cookies est une information déposée sur votre disque dur par le serveur du site que vous visitez. Il contient plusieurs données qui sont stockées sur votre ordinateur dans un simple fichier texte auquel un serveur accède pour lire et enregistrer des informations . Certaines parties de ce site ne peuvent être fonctionnelles sans l’acceptation de cookies.\r\n\r\n<b>Liens hypertextes :</b> Les sites internet de peuvent offrir des liens vers d’autres sites internet ou d’autres ressources disponibles sur Internet. Visiorank ne dispose d''aucun moyen pour contrôler les sites en connexion avec ses sites internet. ne répond pas de la disponibilité de tels sites et sources externes, ni ne la garantit. Elle ne peut être tenue pour responsable de tout dommage, de quelque nature que ce soit, résultant du contenu de ces sites ou sources externes, et notamment des informations, produits ou services qu’ils proposent, ou de tout usage qui peut être fait de ces éléments. Les risques liés à cette utilisation incombent pleinement à l''internaute, qui doit se conformer à leurs conditions d''utilisation.\r\n\r\nLes utilisateurs, les abonnés et les visiteurs des sites internet de ne peuvent mettre en place un hyperlien en direction de ce site sans l''autorisation expresse et préalable de Visiorank.\r\n\r\nDans l''hypothèse où un utilisateur ou visiteur souhaiterait mettre en place un hyperlien en direction d’un des sites internet de Visiorank, il lui appartiendra d''adresser un email accessible sur le site afin de formuler sa demande de mise en place d''un hyperlien. Visiorank se réserve le droit d’accepter ou de refuser un hyperlien sans avoir à en justifier sa décision.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Services fournis : </b></span></p>\r\n<p style="color: #323333;">L''ensemble des activités de la société ainsi que ses informations sont présentés sur notre site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a>.</p>\r\n<p style="color: #323333;">Visiorank s’efforce de fournir sur le site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a> des informations aussi précises que possible. les renseignements figurant sur le site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a> ne sont pas exhaustifs et les photos non contractuelles. Ils sont donnés sous réserve de modifications ayant été apportées depuis leur mise en ligne. Par ailleurs, tous les informations indiquées sur le site www.ecurie-du-saulcy-54.fr<b> </b>sont données à titre indicatif, et sont susceptibles de changer ou d’évoluer sans préavis.</p>\r\n&nbsp;\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Limitation contractuelles sur les données : </b></span></p>\r\nLes informations contenues sur ce site sont aussi précises que possible et le site remis à jour à différentes périodes de l’année, mais peut toutefois contenir des inexactitudes ou des omissions. Si vous constatez une lacune, erreur ou ce qui parait être un dysfonctionnement, merci de bien vouloir le signaler par email, <a href="/contacter-rauscher">contactez-nous</a>, en décrivant le problème de la manière la plus précise possible (page posant problème, type d’ordinateur et de navigateur utilisé, …).\r\n\r\nTout contenu téléchargé se fait aux risques et périls de l''utilisateur et sous sa seule responsabilité. En conséquence, ne saurait être tenu responsable d''un quelconque dommage subi par l''ordinateur de l''utilisateur ou d''une quelconque perte de données consécutives au téléchargement. <span style="color: #323333;">De plus, l’utilisateur du site s’engage à accéder au site en utilisant un matériel récent, ne contenant pas de virus et avec un navigateur de dernière génération mis-à-jour</span>\r\n\r\nLes liens hypertextes mis en place dans le cadre du présent site internet en direction d''autres ressources présentes sur le réseau Internet ne sauraient engager la responsabilité de Visiorank.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Propriété intellectuelle :</b></span></p>\r\nTout le contenu du présent sur le site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a>, incluant, de façon non limitative, les graphismes, images, textes, vidéos, animations, sons, logos, gifs et icônes ainsi que leur mise en forme sont la propriété exclusive de la société à l''exception des marques, logos ou contenus appartenant à d''autres sociétés partenaires ou auteurs.\r\n\r\nToute reproduction, distribution, modification, adaptation, retransmission ou publication, même partielle, de ces différents éléments est strictement interdite sans l''accord exprès par écrit de Visiorank. Cette représentation ou reproduction, par quelque procédé que ce soit, constitue une contrefaçon sanctionnée par les articles L.335-2 et suivants du Code de la propriété intellectuelle. Le non-respect de cette interdiction constitue une contrefaçon pouvant engager la responsabilité civile et pénale du contrefacteur. En outre, les propriétaires des Contenus copiés pourraient intenter une action en justice à votre encontre.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Déclaration à la CNIL : </b></span></p>\r\nConformément à la loi 78-17 du 6 janvier 1978 (modifiée par la loi 2004-801 du 6 août 2004 relative à la protection des personnes physiques à l''égard des traitements de données à caractère personnel) relative à l''informatique, aux fichiers et aux libertés, ce site n''a pas fait l''objet d''une déclaration auprès de la Commission nationale de l''informatique et des libertés (<a href="http://www.cnil.fr/">www.cnil.fr</a>).\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Litiges : </b></span></p>\r\nLes présentes conditions du site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a> sont régies par les lois françaises et toute contestation ou litiges qui pourraient naître de l''interprétation ou de l''exécution de celles-ci seront de la compétence exclusive des tribunaux dont dépend le siège social de la société. La langue de référence, pour le règlement de contentieux éventuels, est le français.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Données personnelles :</b></span></p>\r\nDe manière générale, vous n’êtes pas tenu de nous communiquer vos données personnelles lorsque vous visitez notre site Internet <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a>.\r\n\r\nCependant, ce principe comporte certaines exceptions. En effet, pour certains services proposés par notre site, vous pouvez être amenés à nous communiquer certaines données telles que : votre nom, votre fonction, le nom de votre société, votre adresse électronique, et votre numéro de téléphone. Tel est le cas lorsque vous remplissez le formulaire qui vous est proposé en ligne, dans la rubrique « contact ». Dans tous les cas, vous pouvez refuser de fournir vos données personnelles. Dans ce cas, vous ne pourrez pas utiliser les services du site, notamment celui de solliciter des renseignements sur notre société, ou de recevoir les lettres d’information.\r\n\r\nEnfin, nous pouvons collecter de manière automatique certaines informations vous concernant lors d’une simple navigation sur notre site Internet, notamment : des informations concernant l’utilisation de notre site, comme les zones que vous visitez et les services auxquels vous accédez, votre adresse IP, le type de votre navigateur, vos temps d''accès. De telles informations sont utilisées exclusivement à des fins de statistiques internes, de manière à améliorer la qualité des services qui vous sont proposés. Les bases de données sont protégées par les dispositions de la loi du 1er juillet 1998 transposant la directive 96/9 du 11 mars 1996 relative à la protection juridique des bases de données.', 'Mentions légales', '', 'inherit', 'closed', 'closed', '', '504-revision-v1', '', '', '2018-05-24 09:29:16', '2018-05-24 07:29:16', '', 504, 'http://localhost/ecurie-du-saulcy-54/2018/05/24/504-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(521, 1, '2018-05-24 09:29:18', '2018-05-24 07:29:18', '<h1 style="text-align: center;">Présentation de l''élevage</h1>\r\nLa famille Salagnat est engagée depuis de nombreuses années dans l''élevage de chevaux de sport.\r\n<h2 style="text-align: left;">Roger et Alain Salagnat</h2>\r\n<p style="text-align: center;">[metaslider id="491"]</p>\r\n\r\n<h2>Ulmos du Saulcy, fleuron de l''élevage du Saulcy, gagnant en grands prix et CSI</h2>\r\n<img class="alignnone size-full wp-image-502" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/ulmos.jpg" alt="" width="261" height="193" />\r\n<h2>Hysope du Saulcy, 8e à la finale 6ans</h2>\r\nISO 154 à 7 ans et ISO 165 à 8 ans\r\n\r\n<img class="alignnone size-medium wp-image-517" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/hisop_1-1-300x216.jpg" alt="" width="300" height="216" />\r\n<h2>Idéal du Saulcy, finale 5ans</h2>\r\nISO 145 à 7 ans\r\n\r\n<img class="alignnone size-medium wp-image-519" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/hisop_2-1-300x214.jpg" alt="" width="300" height="214" />', 'Présentation de l''élevage', '', 'inherit', 'closed', 'closed', '', '176-revision-v1', '', '', '2018-05-24 09:29:18', '2018-05-24 07:29:18', '', 176, 'http://localhost/ecurie-du-saulcy-54/2018/05/24/176-revision-v1/', 0, 'revision', '', 0);
