INSERT INTO `wp_posts` VALUES(585, 1, '2018-05-24 09:51:41', '2018-05-24 07:51:41', '<h1>A sa propre image...</h1>\r\n<img class="aligncenter wp-image-562 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000002-11.jpg" alt="" width="142" height="188" />\r\n<h1>...et à celle de ses produits d''élevage...</h1>\r\n<img class="aligncenter wp-image-561 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/bv000001-15.jpg" alt="" width="226" height="156" />\r\n<h1>....Alain Salagnat transmet sont esprit sportif aux membres de l''écurie attirés par la compétition.</h1>\r\nA l''écurie du Saulcy, il est possible de s''entraîner et de sortir en compétition dans les trois disciplines olympiques; CSO, DRESSAGE et CONCOURS COMPLET mais également en HUNTER. Ceci en amateur comme en club.\r\nL''écurie propose des entraînements et des sorties en CSO;\r\nCes derniers sont effectués en coordination entre la monitrice Amandine, le gérant Alain et le cavalier Benoit.\r\nLe jeudi après midi les installations sont réservés pour les entraînements des cavaliers amateurs de CSO (ces derniers sont facturés en plus de la pension).\r\nLes sorties en compétitions se font avec le camion 8 places du club et accompagnées par un des trois intervenants, les transports et le coaching sont facturés hors pensions.', 'Compétition', '', 'inherit', 'closed', 'closed', '', '560-revision-v1', '', '', '2018-05-24 09:51:41', '2018-05-24 07:51:41', '', 560, 'http://localhost/ecurie-du-saulcy-54/2018/05/24/560-revision-v1/', 0, 'revision', '', 0);
