encontre.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Déclaration à la CNIL : </b></span></p>\r\nConformément à la loi 78-17 du 6 janvier 1978 (modifiée par la loi 2004-801 du 6 août 2004 relative à la protection des personnes physiques à l''égard des traitements de données à caractère personnel) relative à l''informatique, aux fichiers et aux libertés, ce site n''a pas fait l''objet d''une déclaration auprès de la Commission nationale de l''informatique et des libertés (<a href="http://www.cnil.fr/">www.cnil.fr</a>).\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Litiges : </b></span></p>\r\nLes présentes conditions du site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a> sont régies par les lois françaises et toute contestation ou litiges qui pourraient naître de l''interprétation ou de l''exécution de celles-ci seront de la compétence exclusive des tribunaux dont dépend le siège social de la société. La langue de référence, pour le règlement de contentieux éventuels, est le français.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Données personnelles :</b></span></p>\r\nDe manière générale, vous n’êtes pas tenu de nous communiquer vos données personnelles lorsque vous visitez notre site Internet <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a>.\r\n\r\nCependant, ce principe comporte certaines exceptions. En effet, pour certains services proposés par notre site, vous pouvez être amenés à nous communiquer certaines données telles que : votre nom, votre fonction, le nom de votre société, votre adresse électronique, et votre numéro de téléphone. Tel est le cas lorsque vous remplissez le formulaire qui vous est proposé en ligne, dans la rubrique « contact ». Dans tous les cas, vous pouvez refuser de fournir vos données personnelles. Dans ce cas, vous ne pourrez pas utiliser les services du site, notamment celui de solliciter des renseignements sur notre société, ou de recevoir les lettres d’information.\r\n\r\nEnfin, nous pouvons collecter de manière automatique certaines informations vous concernant lors d’une simple navigation sur notre site Internet, notamment : des informations concernant l’utilisation de notre site, comme les zones que vous visitez et les services auxquels vous accédez, votre adresse IP, le type de votre navigateur, vos temps d''accès. De telles informations sont utilisées exclusivement à des fins de statistiques internes, de manière à améliorer la qualité des services qui vous sont proposés. Les bases de données sont protégées par les dispositions de la loi du 1er juillet 1998 transposant la directive 96/9 du 11 mars 1996 relative à la protection juridique des bases de données.', 'Mentions légales', '', 'inherit', 'closed', 'closed', '', '504-revision-v1', '', '', '2018-05-24 10:24:18', '2018-05-24 08:24:18', '', 504, 'http://localhost/ecurie-du-saulcy-54/2018/05/24/504-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(632, 1, '2018-05-24 10:24:36', '2018-05-24 08:24:36', '<h1 style="text-align: center;">Les fleurons du Saulcy</h1>\r\nL''élevage du Saulcy a fait naître des chevaux performers au plus haut niveau.\r\n<h2>Voici quelques uns de ses ambassadeurs:</h2>\r\n<h2>Ulmos du Saulcy</h2>\r\n<img class="alignnone size-full wp-image-620" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron1.jpg" alt="" width="261" height="190" />\r\n\r\nEtalon privé - ISO 160 - CSI\r\n\r\nIl a notamment produit:\r\n<ul>\r\n 	<li>ELODEE ICC 132(2004)</li>\r\n 	<li>FULMOS DE NEUVILLE ISO 140(2001) - CSI</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n 	<li>HALIFAX DU CHENET ISO 127(2002)</li>\r\n</ul>\r\n&nbsp;\r\n<h2>Hysope du Saulcy</h2>\r\n<img class="alignnone size-full wp-image-622" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron2.jpg" alt="" width="261" height="190" />\r\n\r\nISO 165(2003) - CSI, performer jusqu''en épreuves 155\r\n\r\n&nbsp;\r\n<h2>Iris du Saulcy</h2>\r\nISO 139(2004) - CSI, performer jusqu''en épreuves 140\r\n\r\n&nbsp;\r\n<h2>Légende du Saulcy</h2>\r\nISO 147(2008) - CSI, performer jusqu''en épreuves 135\r\n\r\n&nbsp;\r\n<h2>Daryl du Saulcy</h2>\r\n<img class="alignnone size-full wp-image-625" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron3.jpg" alt="" width="130" height="85" />\r\n\r\nISO 130(1999) - CSI sous couleurs suisses\r\n\r\n&nbsp;\r\n<h2>Ortie du Saulcy</h2>\r\nISO 130(1987)\r\n\r\n&nbsp;\r\n<h2>Relko du Saulcy</h2>\r\nISO 157(1993) - CSI\r\n\r\n&nbsp;\r\n<h2>Sierra du Saulcy</h2>\r\nISO 133(1991)\r\n\r\n&nbsp;\r\n<h2>Dome du Saulcy</h2>\r\nISO 126(2000)\r\n\r\n&nbsp;\r\n<h2>GALAXIE DU SAULCY ISO 123(1998)</h2>\r\nISO 123(1998)\r\n\r\n&nbsp;\r\n<h2>IDEAL DU SAULCY</h2>\r\n<img class="alignnone size-full wp-image-626" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron4.jpg" alt="" width="240" height="170" />\r\n\r\nISO 147(2004) - CSI\r\n\r\n&nbsp;\r\n<h2>NAUSICAA DU SAULCY</h2>\r\n<img class="alignnone size-medium wp-image-627" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron5-300x200.jpg" alt="" width="300" height="200" />\r\n\r\nISO 143(2008) - CSI\r\n\r\n<img class="alignnone size-medium wp-image-628" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/fleuron6-200x300.jpg" alt="" width="200" height="300" />', 'Les fleurons du Saulcy', '', 'inherit', 'closed', 'closed', '', '353-revision-v1', '', '', '2018-05-24 10:24:36', '2018-05-24 08:24:36', '', 353, 'http://localhost/ecurie-du-saulcy-54/2018/05/24/353-revision-v1/', 0, 'revision', '', 0);
