s, les abonnés et les visiteurs des sites internet de ne peuvent mettre en place un hyperlien en direction de ce site sans l''autorisation expresse et préalable de Visiorank.\r\n\r\nDans l''hypothèse où un utilisateur ou visiteur souhaiterait mettre en place un hyperlien en direction d’un des sites internet de Visiorank, il lui appartiendra d''adresser un email accessible sur le site afin de formuler sa demande de mise en place d''un hyperlien. Visiorank se réserve le droit d’accepter ou de refuser un hyperlien sans avoir à en justifier sa décision.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Services fournis : </b></span></p>\r\n<p style="color: #323333;">L''ensemble des activités de la société ainsi que ses informations sont présentés sur notre site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a>.</p>\r\n<p style="color: #323333;">Visiorank s’efforce de fournir sur le site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a> des informations aussi précises que possible. Les renseignements figurant sur le site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a> ne sont pas exhaustifs et les photos non contractuelles. Ils sont donnés sous réserve de modifications ayant été apportées depuis leur mise en ligne. Par ailleurs, tous les informations indiquées sur le site www.ecurie-du-saulcy-54.fr<b> </b>sont données à titre indicatif, et sont susceptibles de changer ou d’évoluer sans préavis.</p>\r\n&nbsp;\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Limitation contractuelles sur les données : </b></span></p>\r\nLes informations contenues sur ce site sont aussi précises que possible et le site remis à jour à différentes périodes de l’année, mais peut toutefois contenir des inexactitudes ou des omissions. Si vous constatez une lacune, erreur ou ce qui parait être un dysfonctionnement, merci de bien vouloir le signaler par email, <a href="/contact">contactez-nous</a>, en décrivant le problème de la manière la plus précise possible (page posant problème, type d’ordinateur et de navigateur utilisé, …).\r\n\r\nTout contenu téléchargé se fait aux risques et périls de l''utilisateur et sous sa seule responsabilité. En conséquence, ne saurait être tenu responsable d''un quelconque dommage subi par l''ordinateur de l''utilisateur ou d''une quelconque perte de données consécutives au téléchargement. <span style="color: #323333;">De plus, l’utilisateur du site s’engage à accéder au site en utilisant un matériel récent, ne contenant pas de virus et avec un navigateur de dernière génération mis-à-jour</span>\r\n\r\nLes liens hypertextes mis en place dans le cadre du présent site internet en direction d''autres ressources présentes sur le réseau Internet ne sauraient engager la responsabilité de Visiorank.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Propriété intellectuelle :</b></span></p>\r\nTout le contenu du présent sur le site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a>, incluant, de façon non limitative, les graphismes, images, textes, vidéos, animations, sons, logos, gifs et icônes ainsi que leur mise en forme sont la propriété exclusive de la société à l''exception des marques, logos ou contenus appartenant à d''autres sociétés partenaires ou auteurs.\r\n\r\nToute reproduction, distribution, modification, adaptation, retransmission ou publication, même partielle, de ces différents éléments est strictement interdite sans l''accord exprès par écrit de Visiorank. Cette représentation ou reproduction, par quelque procédé que ce soit, constitue une contrefaçon sanctionnée par les articles L.335-2 et suivants du Code de la propriété intellectuelle. Le non-respect de cette interdiction constitue une contrefaçon pouvant engager la responsabilité civile et pénale du contrefacteur. En outre, les propriétaires des Contenus copiés pourraient intenter une action en justice à votre encontre.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Déclaration à la CNIL : </b></span></p>\r\nConformément à la loi 78-17 du 6 janvier 1978 (modifiée par la loi 2004-801 du 6 août 2004 relative à la protection des personnes physiques à l''égard des traitements de données à caractère personnel) relative à l''informatique, aux fichiers et aux libertés, ce site n''a pas fait l''objet d''une déclaration auprès de la Commission nationale de l''informatique et des libertés (<a href="http://www.cnil.fr/">www.cnil.fr</a>).\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Litiges : </b></span></p>\r\nLes présentes conditions du site <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a> sont régies par les lois françaises et toute contestation ou litiges qui pourraient naître de l''interprétation ou de l''exécution de celles-ci seront de la compétence exclusive des tribunaux dont dépend le siège social de la société. La langue de référence, pour le règlement de contentieux éventuels, est le français.\r\n<p style="color: #b51a00;"><span style="color: #000000;"><b>Données personnelles :</b></span></p>\r\nDe manière générale, vous n’êtes pas tenu de nous communiquer vos données personnelles lorsque vous visitez notre site Internet <a href="http://localhost/ecurie-du-saulcy-54">www.ecurie-du-saulcy-54.fr</a>.\r\n\r\nCependant, ce principe comporte certaines exceptions. En effet, pour certains services proposés par notre site, vous pouvez être amenés à nous communiquer certaines données telles que : votre nom, votre fonction, le nom de votre société, votre adresse électronique, et votre numéro de téléphone. Tel est le cas lorsque vous remplissez le formulaire qui vous est proposé en ligne, dans la rubrique « contact ». Dans tous les cas, vous pouvez refuser de fournir vos données personnelles. Dans ce cas, vous ne pourrez pas utiliser les services du site, notamment celui de solliciter des renseignements sur notre société, ou de recevoir les lettres d’information.\r\n\r\nEnfin, nous pouvons collecter de manière automatique certaines informations vous concernant lors d’une simple navigation sur notre site Internet, notamment : des informations concernant l’utilisation de notre site, comme les zones que vous visitez et les services auxquels vous accédez, votre adresse IP, le type de votre navigateur, vos temps d''accès. De telles informations sont utilisées exclusivement à des fins de statistiques internes, de manière à améliorer la qualité des services qui vous sont proposés. Les bases de données sont protégées par les dispositions de la loi du 1er juillet 1998 transposant la directive 96/9 du 11 mars 1996 relative à la protection juridique des bases de données.', 'Mentions légales', '', 'inherit', 'closed', 'closed', '', '504-revision-v1', '', '', '2018-05-24 10:55:53', '2018-05-24 08:55:53', '', 504, 'http://localhost/ecurie-du-saulcy-54/2018/05/24/504-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(639, 1, '2018-05-24 10:59:45', '2018-05-24 08:59:45', '<h1 style="text-align: center;">Les Poulinières</h1>\r\nDeux poulinières sont actuellement en activité à l''élevage du Saulcy:\r\n\r\n&nbsp;\r\n<h2>Nigelle du Saulcy</h2>\r\n<img class="aligncenter wp-image-633 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/pouliniere1.jpg" alt="" width="512" height="300" />\r\n\r\nSon père, Ulmos du Saulcy, très grand gagnant en CSO, ISO 160, s''avère être également un excellent reproducteur. Il a notamment produit ELODE ICC 132(20044), FULMOS DE NEUVILLE ISO 140(2001), HYSOPE DU SAULCY ISO 165(2003), ILLA II ISO 140(2002)...\r\n\r\nSa mère, STAR DE L''OLIVIERE, par DOUBLE ESPOIR, ISO 133(1992) a notamment produit:\r\n<ul id="s2h">\r\n 	<li>BEAU SOLEIL II, par CHAMBERLIN, ISO 122(2003)</li>\r\n 	<li><b>HYSOPE DU SAULCY, par ULMOS DU SAULCY, ISO 165(2003), propre frère de Nigelle</b></li>\r\n 	<li>IRIS DU SAULCY, par QUEL TYPE D''ELLE, ISO 139(2004)</li>\r\n 	<li><b>LEGENDE DU SAULCY,par AHORN (NL), ISO 147(2008)</b></li>\r\n</ul>\r\n<b>C''est la famille maternelle de ECHO DE CAVRON  ISO 175(1980) IE SO, JIJI DE CAVRON ISO 158(1983), ROI DE CAVRON IE SO...</b>\r\n\r\n&nbsp;\r\n<h2>Kaoline du Saulcy</h2>\r\n<img class="wp-image-637 size-full aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/pouliniere2.jpg" alt="" width="512" height="300" />', 'Les Poulinières', '', 'inherit', 'closed', 'closed', '', '384-revision-v1', '', '', '2018-05-24 10:59:45', '2018-05-24 08:59:45', '', 384, 'http://localhost/ecurie-du-saulcy-54/2018/05/24/384-revision-v1/', 0, 'revision', '', 0);
INSERT INTO `wp_posts` VALUES(640, 1, '2018-05-24 11:11:24', '2018-05-24 09:11:24', '<h1 style="text-align: center;">Les Poulinières</h1>\r\nDeux poulinières sont actuellement en activité à l''élevage du Saulcy:\r\n\r\n&nbsp;\r\n<h2>Nigelle du Saulcy</h2>\r\n<img class="aligncenter wp-image-633 size-full" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/pouliniere1.jpg" alt="" width="512" height="300" />\r\n\r\nSon père, Ulmos du Saulcy, très grand gagnant en CSO, ISO 160, s''avère être également un excellent reproducteur. Il a notamment produit ELODE ICC 132(20044), FULMOS DE NEUVILLE ISO 140(2001), HYSOPE DU SAULCY ISO 165(2003), ILLA II ISO 140(2002)...\r\n\r\nSa mère, STAR DE L''OLIVIERE, par DOUBLE ESPOIR, ISO 133(1992) a notamment produit:\r\n<ul id="s2h">\r\n 	<li>BEAU SOLEIL II, par CHAMBERLIN, ISO 122(2003)</li>\r\n 	<li><b>HYSOPE DU SAULCY, par ULMOS DU SAULCY, ISO 165(2003), propre frère de Nigelle</b></li>\r\n 	<li>IRIS DU SAULCY, par QUEL TYPE D''ELLE, ISO 139(2004)</li>\r\n 	<li><b>LEGENDE DU SAULCY,par AHORN (NL), ISO 147(2008)</b></li>\r\n</ul>\r\n<b>C''est la famille maternelle de ECHO DE CAVRON  ISO 175(1980) IE SO, JIJI DE CAVRON ISO 158(1983), ROI DE CAVRON IE SO...</b>\r\n\r\n&nbsp;\r\n<h2>Kaoline du Saulcy</h2>\r\n<img class="wp-image-637 size-full aligncenter" src="http://localhost/ecurie-du-saulcy-54/wp-content/uploads/2018/05/pouliniere2.jpg" alt="" width="512" height="300" />\r\n\r\nCette poulinière associe le sang de Voltaire à celui précieux d''Uriel par son fils, Hidalgo de Riou.\r\n\r\nSon père, Voltaire, très grand reproducteur, est le père notamment de KELLEMOI DE PEPITAISO 178(2010) BSO +18(0.63) et des étalons KANNAN ISO 178(2004) BSO +28(0.98), IMPERIAL D''HERBIERS ISO 159(2006) BSO +19(0.82), KLOTAIRE DU MOULIN ISO 176(2007) BSO +16(0.62)...\r\n\r\nSa mère, Vestale du Saulcy a huit produits indicés sur onze en âge de l''être:\r\n<ul id="s2h">\r\n 	<li>DOME DU SAULCY, par LE PEGRIOT, ISO 126(2000)</li>\r\n 	<li>GALAXIE DU SAULCY, par KAN VIENS TU, ISO 123(1998)</li>\r\n 	<li><b>IDEAL DU SAULCY, par QUEL TYPE D''ELLE, ISO 147(2004)</b></li>\r\n 	<li>LINGOT DU SAULCY, par CALANDO I (DE),ISO 121(2009)</li>\r\n 	<li><b>NAUSICAA DU SAULCY,par MR BLUE (NL), ISO 143(2008)</b></li>\r\n</ul>\r\nSa deuxième mère, AMAZONE D, par QUELTIMATE, a notamment produit:\r\n<ul id="s2h">\r\n 	<li>ORTIE DU SAULCY, par HIDALGO DE RIOU, ISO 130(1987)</li>\r\n 	<li><b>RELKO DU SAULCY,par HIDALGO DE RIOU, ISO 157(1993) </b></li>\r\n 	<li><b> SIERRA DU SAULCY, ISO 133(1991) </b></li>\r\n 	<li>ULMOS DU SAULCY, par HIDALGO DE RIOU, ISO 160(1995)  Etalon privé**</li>\r\n</ul>\r\n&nbsp;\r\n<h2>Voir la production à vendre</h2>\r\n<a href="http://localhost/ecurie-du-saulcy-54/elevage/a-vendre/">Cliquez ici</a>&nbsp;', 'Les Poulinières', '', 'inherit', 'closed', 'closed', '', '384-revision-v1', '', '', '2018-05-24 11:11:24', '2018-05-24 09:11:24', '', 384, 'http://localhost/ecurie-du-saulcy-54/2018/05/24/384-revision-v1/', 0, 'revision', '', 0);
